<p><strong>Sistema de Loja de Roupas:</strong>
Crie um sistema para gerenciar uma loja de roupas. A loja tem vrios departamentos, como roupas masculinas, femininas e infantis. Cada departamento contm vrios produtos (roupas) com informaes como preo, tamanho e cor. Os clientes podem adicionar produtos ao carrinho de compras e finalizar suas compras. Implemente funcionalidades para calcular o total das compras e listar os produtos em um carrinho.</p>
